import React, { useState, useEffect } from "react";
import { useSelector, useDispatch } from "react-redux";
import Cards from "../components/Cards";

import "../css_styles/TechList.css";
import { listTechs } from "../actions/techActions";

const TechList = () => {
  const dispatch = useDispatch();
  const techList = useSelector((state) => state.techList);
  const { error, loading, techs } = techList;

  useEffect(() => {
    dispatch(listTechs());
  }, [dispatch]);

  // const [techs, setTechs] = useState([]);
  // useEffect(() => {
  //   async function fetchTech() {
  //     const { data } = await axios.get(
  //       "http://127.0.0.1:8000/api/technology/list/"
  //     );
  //     setTechs(data);
  //   }
  //   fetchTech();
  // }, []);
  // console.log("tech", techs);

  return (
    <>
      <div className="techlist">
        <div className="techlist_headline">
          <div className="techlist_headline1">headline1</div>
          <div className="techlist_headline2">headline2</div>
        </div>
        <div className="techlist_banner">banner</div>

        <div className="techlist_main">
          <div className="techlist_main_inside">
            <div className="techlist_main_text">
              <div className="techlist_main_text1"></div>
              <div className="techlist_main_text2">Latest news</div>
            </div>
            <div className="techlist_main_news">
              <div className="techlist_main_news1">
                {techs.map((tech) => (
                  <Cards key={tech.id} tech={tech} />
                ))}{" "}

              </div>
              <div className="techlist_main_news2">
                <div className="techlist_main_ads">
                  <div className="techlist_maid_ads_header">
                    <div className="techlist_maid_ads_header1"></div>
                    <div className="techlist_maid_ads_header2">Advertise</div>
                  </div>
                  <div className="techlist_maid_ads_items">advertise</div>
                </div>
              </div>
            </div>
          </div>
        </div>

        <div className="techlist_footer">
          <div className="techlist_footer_items">
            <div className="techlist_footer_items1">
              <div className="techlist_footer_getInTouch"><h2>GET IN TOUCH </h2></div>
              <div className="techlist_footer_getInTouch_items">
                  <h2>Caroline Colony, Jowai, West Jaintia Hill</h2>
                  <h2>@mystardust000</h2>
              </div>
            </div>
            <div className="techlist_footer_items2">
              <div className="techlist_footer_category">
                <div className="techlist_footer_category">
                  <h2>CATEGORIES</h2>
                </div>
                <div className="techlist_footer_category_items">
                  <div><h2 className="techlist_footer_category_items1">Science</h2></div>
                  <div><h2 className="techlist_footer_category_items1">Health</h2></div>
                  <div><h2 className="techlist_footer_category_items1">Technology</h2></div>
                  <div><h2 className="techlist_footer_category_items1">Business</h2></div>
                </div>
              </div>
            </div>
            <div className="techlist_footer_items3">
              <h2>ASSOCIATES</h2>
            </div>
          </div>
        </div>
      </div>

      <div className="techlist_brand">hi</div>
    </>
  );
};

export default TechList;
